            "recipientId" : "152967584",
            "reactions" : [ ],
            "urls" : [ ],
            "text" : "The Scarlett 2i2 can work with my MBP M1 on macOS Big Sur but does not work on mac OS Monterey  beta.\nSimilarly, it can work with my iPad Pro A12Z (iOS 14) but not the new iPad Pro M1 (iOS 15 beta).",
