            "text" : "Thank you for following me and How are you doing today? I am Mrs.Judy M.Carver a widow to late Mr. Jones Carver. I am 65 years old, i was a missionary but stopped when I discovered I have a breast cancer disease,the doctor said its critical and I won't live more than Four-month, According to the medical result the Cancer disease has gotten to a very bad stage.\n\nI want you to answer the following questions, (1) Are you a God-fearing person? (2) If I donate 5 Million United States Dollars to you, can you be able to utilize it wisely to achieve my heart desire of supporting poor people around you? (3) Will you open a charity foundation in the name of my husband and I?\n\nI really need you to use the funds to help the poor which is very essential and also the widow and cancer patient,Orphanage children those who could not speak for them selves. I know this is hard, and it takes a very strong heart to get this done, but you should keep this saying in your heart, I am like Moses in the Bible. He came to the Red Sea and Pharaoh behind him and no way to turn but God delivered him all by a miraculous deliverance. It will be a miracle from God to be able to help all the dear people God has laid on our hearts, as you have been laid on my heart for a period of time.\n\nTo proceed with the charity work for the less privilege. I cannot continue to do all these by myself anymore. I strongly desire to reach out to the poor and needy people, but due to my health condition I would prefer to continue this with the assistance of a kind person.\n\nThe Bible made us understand that blessed is the hand that giveth. I took this decision because I don't have any child that will inherit this money and I don't want my husband's efforts to be used by those who do not believe in God. I don't want a situation where this money will be used in an ungodly way. This is why I am taking this decision. I am not afraid of death hence i know where I am going. I know that I am going to be in the bosom of the Lord.\nExodus 14 VS 14 says that the Lord will fight my case and I shall hold my peace.\n\nI don't need any telephone communication in this regard because of my health hence the presence of my husband's relatives around me always I don't want them to know about this development. With God all things are possible. I want you to always pray for me because the Lord is my shepherd. My happiness is that I lived a life of a worthy Servant of God. Whoever that wants to serve the Lord must serve him in spirit and Truth. Please always be prayerful all through your life.\n\nThis is why with God in my heart I contact you and I want you to contact me so we are in contact with all the poor souls out there. Give new lives, hopes and days. I have come to find out that wealth acquisition without Christ is vanity and I hope you will agree with this also. I will be praying hard that Satan will not stop this effort. Do contact me and i will tell you more of what you wish to know. Note that the Lord has a great reason for me contacting you and I will be very grateful if you will heed to the call of the Lord by replying to me on my personal email address on (judymcarver1@gmail.com)\nAny delay in your reply will give me a room in sourcing another church or individual for this same purpose. Please assure me that you will act accordingly as I stated herein. Hoping to receive your reply on my mail now.\n\nYours in Christ,\nRemember me in your daily prayers.\nMrs. Judy Carver.\njudymcarver1@gmail.com",
