            "text" : "Hi Leask. We're thrilled to share with you the message that we've launched a grand contest together with Elegoo, the MOVEIT 3DP SHOW! And we'd like to invite you to join.\n\nIt's a contest requiring the participants to create a movable project with 3D printing element and share the video of it on social media platforms. The winners will be rewarded with up to $5000 and other attractive prizes.\n\nWe believe it's not difficult for you considering your past amazing projects. If you're interested, please submit your project before JUL 19. Here are the detailed rules and ways to enter: https://t.co/jkJgBa1Uej.\n\nBTW, this contest is not limited to Snapmaker and Elegoo users. We'd appreciate it if you can help to retweet this tweet (https://t.co/MgvQqERPfK) and share it with your maker friends.\n\nIf you have any question or advice about the contest, feel free to tell us. Look forward to your participation! Stay safe and healthy.",
